import React,{useState} from 'react';

const FormRegis = () => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

    const handleSubmit = (e) =>{
        e.preventDefault()
        console.log(email,pass)
    }
    return (
        <div>
            <form>
                {/* <div class="mb-3">
                    <input type="text" class="form-control" id="exampleInputPassword1" placeholder='username'/>
                </div> */}
                <div class="mb-3">
                    <input type="email" onChange={((e)=>{
                         setEmail(e.target.value)
                    })} value={email} class="form-control" id="exampleInputEmail1" placeholder='email' aria-describedby="emailHelp" />
                </div>
                <div class="mb-3">
                    <input type="password" onChange={((e)=>{
                         setPass(e.target.value)
                    })} value={pass} class="form-control" id="exampleInputPassword1"  placeholder='password' />
                </div>
                <div className="submit d-flex align-items-center">
                    <a onSubmit={handleSubmit}  class="btn btn-danger me-3">Regis</a>
                    or

                    <button class="btn">Login With Google</button>
                </div>
            </form>
        </div>
    );
}

export default FormRegis;
